var ready;
ready = function() {
  $('body').on("click", '#users_tabs li', function(e) {
      $(this).tab('show');
      var role = $(this).attr('role');
      $('#users_search #role').val(role);
      $('#users_search .warning input').val('');
    });  
  };
$(document).ready(ready);
$(document).on('page:load', ready)



